/* eslint-disable no-unused-vars */
import { Tooltip } from "@mui/material";

const Marker = (props) => {
  const {
    id,
    chartId,
    name,
    description,
    renders,
    antiproject,
    design,
    designer,
    source,
    estimatedCost,
    lastDate,
    costM,
    cords,
    onClick,
    color,
  } = props;
  return (
    <Tooltip title={name} placement="top">
      <g>
      <circle
  onMouseOver={(evt) => evt.target.setAttribute('r', '15')}
  onMouseOut={(evt) => evt.target.setAttribute('r', '10')}
  cx={cords.x}
  cy={cords.y}
  r={11}
  fill={color}
  stroke="white"
  strokeWidth={2} 
  onClick={() => onClick(props)}
/>
<text
  x={cords.x- 2} 
  y={cords.y+ 3.5}
  fill="black"
  style={{ fontSize: "11.2px", fontWeight: "bold" }}
>
  {chartId}
</text>
  </g> 
    </Tooltip>
  );
};

export default Marker;
